import React, { Component } from 'react'

export default class Components extends Component {
    render() {
        return (
            <div>
                  <div className='container mt-4'>

                     <div className='row'>

                      {/* //////////first column/////////// */}
                          <div className='col-md-8 '>
                                  <div className='box1'>
                                          <h6>You may also Like</h6>
                                  </div>
                          </div>


                          {/* ///second column///////////// */}

                          <div className='col-md-4 '>
                                <div className='box2'>
                                         
                                </div>
                          </div>

                          </div>
                  </div>
            </div>
        )
    }
}
